css:
.ink-lint-inline .ink-lint-description-container {
  color: #abb2bf;
  padding: 0px 0.5em 0px 0.5em;
  transition: all 0.2s;
  opacity: 1;
  cursor: default;
  user-select: auto;
  pointer-events: auto;
  background-color: #31363f;
  border-left: 8px solid #ad7c0b;
}
.ink-lint-inline .ink-lint-arrow-up {
  height: 0px;
  width: 100%;
  border-left: 8px solid #ad7c0b;
  border-top: 8px solid rgba(0, 0, 0, 0);
}
.ink-lint-line {
  border-bottom: 1px solid #282c34;
}
.region.ink-linter-warning {
  z-index: 2 !important;
  border-bottom: 1px dotted #ad7c0b;
}
.region.ink-linter-error {
  z-index: 2 !important;
  border-bottom: 1px dotted #d13b2e;
}
.ink-linter-gutter-warning {
  color: #ad7c0b;
}
.ink-linter-gutter-error {
  color: #d13b2e;
}
.gutter[gutter-name="ink-linter-gutter"] {
  width: 1.4em;
}
